     <h2 id="section-title">N.American Land Data Assimilation System</h2>
     <img src="../../pages/disclaimer/disclaimer_small.png"  />
     	<div id="description">
				<p style="margin-top: 0.19in; margin-bottom: 0.19in; line-height: 100%" align="center">
				<img name="Picture 1" src="data:image/png;base64," style="float: right;" width="263" height="172" border="0" align="bottom"></p>

                <p style="margin-top: 0.19in; margin-bottom: 0.19in; line-height: 100%">
                    <font face="Times New Roman, serif" style="font-size: 13pt" size="4">
                    	<b>North American Land Data Assimilation System</b>
                    </font>
                </p>

<p style="margin-bottom: 0in; line-height: 115%">
<font face="Times New Roman, serif" style="font-size: 12pt" size="3">The North American Land Data Assimilation System (NLDAS) is a multi-model land modeling and assimilation system run in an 
uncoupled mode on a common one-eighth degree grid covering the Continental United States (CONUS) along with northern Mexico and southern Canada, and driven by 
atmospheric forcing.&nbsp;The NLDAS is a multi-institutional collaborative project that has comprised two major phases so far. Phase 1 (NLDAS-1, 
</font>

<font face="Times New Roman, serif" style="font-size: 12pt" size="3"><i>Mitchell et al., 2004</i></font>

<font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">) was initiated in 1999 with the purpose of establishing a land data assimilation 
framework that includes four land surface models (Figure 1), high-quality meteorological forcing, soil and vegetation parameters, and validation datasets. 
Phase 2 (NLDAS-2, </font></font>
<font face="Times New Roman, serif">
	<font style="font-size: 12pt" size="3"><i>Xia et al., 2012a; 2013a</i></font>
</font>
<font face="Times New Roman, serif">
	<font style="font-size: 12pt" size="3">) is an extension of the Phase 1 with the key purpose of producing quality-controlled long-term and near real-time products 
	to support the national operational drought monitoring, prediction, and water resource information needs of various government agencies, academia, and enterprises. 
	</font>
</font>
</p>

<p style="margin-bottom: 0in; line-height: 100%">
<style type="text/css">p { margin-bottom: 0.1in; direction: ltr; line-height: 120%; text-align: left; }a:link { color: rgb(0, 0, 255); }
</style>
</p>

<p style="margin-bottom: 0in; line-height: 100%"><img alt="" src="data:image/png;base64," width="833" height="625"></p>

<p style="margin-bottom: 0in; line-height: 100%"><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><b>Figure 1: </b></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">Four Land Surface Models used in NLDAS-1 and NLDAS-2 (clockwise from upper-left: Noah, Mosaic, VIC, and SAC).</font></font></p>

<p style="margin-bottom: 0in; line-height: 100%">&nbsp;</p>

<p style="margin-bottom: 0in; line-height: 100%"><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">NLDAS Phase 2 provides retrospective and near real-time (with 3.5-day delay) high-resolution water and energy cycle products, such as surface fluxes, soil moisture, snow cover, and runoff/streamflow, along with the near-surface atmospheric and precipitation data sets used as forcing for the NLDAS land models. These products support drought monitoring, seasonal hydrological prediction, weather and climate forecasting, model evaluation, and land-hydrology research within various communities.&nbsp; To provide reliable NLDAS-2 products, we comprehensively evaluate many variables such as soil moisture (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Xia et al., 2014; Xia et al., 2015a; 2015b; Cai et al., 2016</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">), soil temperature (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Xia et al., 2013b</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">), total runoff/streamflow (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Xia et al., 2012b; Cai et al., 2016</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">), snow water equivalent (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Livneh et al., 2010</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">) and evapotranspiration (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Peters-Lidard et al., 2011; Xia et al., 2015c; Nearing et al., 2016</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">). The weaknesses and strengths of the NLDAS-2 system and individual model products are detailed in these studies. For more details, users can see the Publications Tab and the Presentations Tab of the EMC and the NASA NLDAS websites listed below. </font></font></p>

<p style="margin-bottom: 0in; line-height: 100%"><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">The near real-time NLDAS-2 was implemented into NCEP operations in 2014 after a ~35-year (1979-2014) retrospective component of NLDAS-2. The advances and prospective of NLDAS including models and system upgrade (e.g., NLDAS v2.5, NLDAS v3.0, and beyond) are well described in a recently-released NCEP LDAS white paper (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Ek et al., 2017</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">). The real-time NLDAS v2.5 (Figure 2) is being tested and will be operationally implemented at NCEP soon. </font></font></p>

<p style="margin-top: 0.19in; margin-bottom: 0.19in; line-height: 100%"><img name="Picture 3" src="data:image/png;base64," width="637" height="359" border="0" align="bottom"></p>

<p style="margin-bottom: 0in; line-height: 100%"><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><b>Figure 2: </b>Schematic Flow Chart for NLDAS v2.5</font></font></p>

<p style="margin-top: 0.19in; margin-bottom: 0.19in; line-height: 100%"><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">The NLDAS Phase 3 system, sponsored by the NOAA CPO (Climate Program Office), is a research-based system that is jointly developed by the NCEP and NASA NLDAS team. NLDAS-3 will use the NASA-developed Land Information System (LIS, </font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Kumar et al., 2006</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">) software framework, upgraded land surface models, and soil moisture and snowpack data assimilation processes. The SAC model (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Burnash et al., 1973</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">) will be replaced by the Noah-MP model (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Niu et al., 2011</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">), and the Mosaic (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Koster and Suarez, 1994</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">) model will be replaced by the NASA Catchment land surface model (CLSM</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>, Koster et al., 2000</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">). These new NLDAS models include groundwater physics, which were recently evaluated by </font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Xia et al.</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"> (2017). The Noah (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Chen et al., 1997</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">) and VIC (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Liang et al., 1994</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">) models will also be upgraded to versions 3.6 and 4.1.2, respectively. The 39-year (1979-2017) retrospective run and some science-related experiments are being performed in NASA, and it is proposed to transition this system to NCEP to perform a R2O task sponsored by the Climate Testbed. The similarity between various LSMs from NLDAS-2 and from the research-based NLDAS-3 is analyzed and evaluated (</font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><i>Kumar et al., 2017</i></font></font><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">). Comparison, evaluation, and benchmarking of the NLDAS-3 LSMs as compared to NLDAS-2 are also being performed as part of the NLDAS Science Testbed.</font></font></p>

<p style="margin-top: 0.19in; margin-bottom: 0.19in; line-height: 100%"><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">For additional information on the NLDAS, please see the websites listed below:</font></font></p>

<p style="margin-top: 0.19in; margin-bottom: 0.19in; line-height: 100%"><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">- </font></font><a href="http://www.weather.gov/nwsexit.php?url=https://ldas.gsfc.nasa.gov/nldas/"><font color="#0000ff"><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><u>NASA NLDAS web site</u></font></font></font></a></p>

<p style="margin-top: 0.19in; margin-bottom: 0.19in; line-height: 100%"><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3">- </font></font><a href="http://www.emc.ncep.noaa.gov/impdoc/NLDAS/NLDASv2.0.0-CCB-APR2014.pdf"><font color="#0000ff"><font face="Times New Roman, serif"><font style="font-size: 12pt" size="3"><u>EMC Description of NCEP production NLDAS implementation in 2014 </u></font></font></font></a></p>

